from random import randomN = 15b = [0] * Nfor i in range(N):    b[i] = int(random() * 20)print(b)num = b[0]max_frq = 1for i in range(N-1):    frq = 1    for k in range(i+1,N):        if b[i] == b[k]:            frq += 1    if frq > max_frq:        max_frq = frq        num = b[i]if max_frq > 1:    print(max_frq, 'раз(а) встречается число', num)else:    print('nan')